import React, { useState } from 'react';
import './App.css';

function App() {

  const [message, setMessage] = useState('empty');

  async function handleClick() {

    var requestOptions = {
      method: 'GET',
      redirect: 'follow'
    };

    let response = await fetch("http://localhost:8080/users/get-message", requestOptions);
    let message = await response.json();
    setMessage(message);
  }

  return (
    <div className="App">
      <button onClick={handleClick}></button>
      <a> This is a message: {message}</a>
    </div>
  );
}

export default App;
